description:
The movie opens with a splendidly erotic scene with Beth Anna, which turns out to be a dream of the guy she left behind when her mother and her moved out of Kansas.
Barby Barsky (Beth Anna) is a high school girl going to her first day at a new school after moving from Kansas, and hoping to meet new friends. She soon meets a trio of girls called the Bali High Bunnies. One of the girls, Cindy, wants to be nice to her, but the other two don't want to sully their reputation by talking to an &quot;ugly&quot; girl. The bunnies leave to be with their guys and go back to watch a porno and have sex. Two months later, Barby is still sulking that no one will befriend her, but then luckily Cindy stops by to give her a makeover. Of course no makeover would be complete with a lesbian tryst. So now the new and improved Barby can be as much as a slut as the other girls - YAY!! But wait first she must pass a long sexual initiation and the gang bang test - UH OH! Her wonderful quest for sexual awareness teaches the Bali High Bunnies what an expert Barbie really is... 

